// HomePage.js
import React, { useState, useEffect } from "react";
import { Link } from "react-router-dom";
import axios from "axios";
import emailSymbol from "./images/email.jpg";
import locationSymbol from "./images/location.jpg";
import messageSymbol from "./images/message.jpg";
import phoneSymbol from "./images/phone.jpg";
import "./HomePage.css";

const HomePage = () => {
  const [subject, setSubject] = useState("");
  const [mainText, setMainText] = useState("");

  const handleSubmit = (e) => {
    e.preventDefault();

    // Prepare data object to be sent to the server
    const data = {
      subject: subject,
      mainText: mainText,
    };

    // Send the data to the backend server using Axios
    axios
      .post("/submit_data", data)
      .then((response) => {
        console.log(response.data);
        // Optionally, you can reset the form fields after successful submission
        setSubject("");
        setMainText("");
      })
      .catch((error) => {
        console.error("Error submitting data:", error);
      });
  };

  const handleClearText = () => {
    setSubject("");
    setMainText("");
  };

  const [data, setData] = useState([{}]);

  useEffect(() => {
    fetch("/members")
      .then((res) => res.json())
      .then((data) => {
        setData(data);
        console.log(data);
      });
  }, []);

  return (
    <div>
      <div class="header">
        <div class="allTextHeader">
          <div>
            <p class="Title">HappyHounds</p>
          </div>

          <div class="headerLinks">
            <Link to="/" className="Home-page">
              HOME
            </Link>
            <Link to="/profile" className="profile">
              PROFILE
            </Link>
            <Link to="/login" className="login">
              LOGIN
            </Link>
          </div>
        </div>
      </div>

      <div class="main-content">
        <div class="LeftBox">
          <form onSubmit={handleSubmit}>
            <p className="MessageTitle">Send us a Message</p>

            <input
              type="text"
              placeholder="Enter your subject"
              className="Text-Box-subject"
              value={subject}
              onChange={(e) => setSubject(e.target.value)}
            />
            <textarea
              type="text"
              placeholder="Enter your subject"
              className="Text-Box-main"
              value={mainText}
              onChange={(e) => setMainText(e.target.value)}
            />
            <button type="submit">Submit</button>
            <button onClick={handleClearText}>Clear Text</button>
          </form>
        </div>

        <div class="RightBox">
          <div class="box">
            <img
              src={emailSymbol}
              alt="Example"
              className="Symbol"
              style={{ width: "4vw", height: "auto" }}
            />
          </div>
          <div class="box">
            <img
              src={locationSymbol}
              alt="Example"
              className="Symbol"
              style={{ width: "4vw", height: "auto" }}
            />
          </div>
          <div class="box">
            <img
              src={messageSymbol}
              alt="Example"
              className="Symbol"
              style={{ width: "4vw", height: "auto" }}
            />
          </div>
          <div class="box">
            <img
              src={phoneSymbol}
              alt="Example"
              className="Symbol"
              style={{ width: "4vw", height: "auto" }}
            />
          </div>
        </div>
      </div>

      <div class="footer">
        <Link to="/contact" className="contact">
          CONTACT US
        </Link>
      </div>
    </div>
  );
};

export default HomePage;
